import * as React from "react";
import BottomNavigation from "@mui/material/BottomNavigation";
import { Typography } from "@mui/material";

export default function Footer() {
  return (
    <BottomNavigation
      sx={{
        maxWidth: "200em",
        mt: 10,
        bottom: "12.33%",
        background: " #01312B",
        height: "377px",
      }}
    >
      <Typography>LOGO</Typography>
    </BottomNavigation>
  );
}
